import React from "react";
import {
    View,
    Text,
    Button
} from 'react-native';

const SectionContacts = ({ navigation }) => {

    return (
        <View>
            <Button
                title="Home"
                onPress={() => navigation.navigate('Home')}
            />

            <Button
                title="Nosotros"
                onPress={() => navigation.navigate('Nosotros')}
            />
        </View>

    )
}


export default SectionContacts;
